import React, { Component } from 'react'

export class TempD extends Component {
  constructor(props) {
    super(props)

    this.state = {
      flightDetail: this.props.flightDetail,
    }
  }

  render() {
    return (
      <div>
        {this.state.flightDetail.map((temp) => (
          <div>{temp.seats}</div>
        ))}
      </div>
    )
  }
}

export default TempD
